import styled from "styled-components"

const NavBar = () => {
    const logo = "https://ortex-static-files.s3.amazonaws.com/static/public/images/ortex_logo_v-white.svg"
    return <Section><Title>ORTEX <img alt="logo" src={logo} /></Title></Section>
}

export default NavBar;

const Section = styled.header`
  border-bottom: 1px solid white;
  margin: 0;
  margin-bottom: 1rem;
  padding: 0;
  width: 100%;
  height: 5.5rem;
`

const Title = styled.h1`
    padding-left: 1em ;
    padding-top: 0.5em;
    font-weight: 200;
    letter-spacing: 10px;
`
